    internal InnerPackageGroupRestrictionTypeFactory ExternalUpstreamFactory { get; set; }

    internal InnerPackageGroupRestrictionTypeFactory PublishFactory { get; set; }

    internal InnerPackageGroupRestrictionTypeFactory InternalUpstreamFactory { get; set; }

    protected override Humidifier.CodeArtifact.PackageGroupTypes.Restrictions Create()
    {
        var restrictionsResult = CreateRestrictions();
        factoryAction?.Invoke(restrictionsResult);

        return restrictionsResult;
    }

    private Humidifier.CodeArtifact.PackageGroupTypes.Restrictions CreateRestrictions()
    {
        var restrictionsResult = new Humidifier.CodeArtifact.PackageGroupTypes.Restrictions();

        return restrictionsResult;
    }
    public override void CreateChildren(Humidifier.CodeArtifact.PackageGroupTypes.Restrictions result)
    {
        base.CreateChildren(result);

        result.ExternalUpstream ??= ExternalUpstreamFactory?.Build();
        result.Publish ??= PublishFactory?.Build();
        result.InternalUpstream ??= InternalUpstreamFactory?.Build();
    }

} // End Of Class

